import React from 'react';
import styled from 'styled-components';

const NewSong = () => {
  return (
    <NewSongWrapper>
      <div className='add-section'></div>
    </NewSongWrapper>
  );
};
const NewSongWrapper = styled.div`
  .add-button {
    font-size: 40px;
    color: white;
    cursor: pointer;
  }
`;
export default NewSong;
